response.about:
х.:-Можно с вами познакомится?
у.:-Нет.
х.:-Почему?
у.:-Мне с вами будет скучно, а вам со мной не понятно.
х.:-Почему?
у.:-Потому что мне уже скучно , а вам уже не понятно.

Характер — сформированный;
вредность — повышенная;
стервозность — безграничная;
красота — натуральная;
соображалка — развитая;
нежность — как награда;
улыбка — как бонус;
изменить, приручить — невозможно!
